function getSubsectionsWithId(data, sectionName) {
  const filteredItem = data.find(item => item.tdlogSection_section === sectionName);

  if (!filteredItem) {
    return []; // Return an empty array if no matching section is found
  }

  return filteredItem.tdlogSection_subsection
    .slice(1, -1) // Remove the surrounding brackets
    .split(',')   // Split by commas
    .map((sub, index) => ({
      id: index + 1,
      subsection: sub.trim().replace(/^'|'$/g, '') // Trim spaces and remove single quotes
    }))
    .filter(subObj => subObj.subsection.length > 0); // Remove empty strings
}


